import './App.css';
import { Container } from "react-bootstrap"
import Footer from './components/Footer';
import Header from './components/Header';
import HomeScreen from './screen/HomeScreen';



function App() {
  return (
    <>
      <Header />
      <main>
        <Container>
          <h1>ibrahim</h1>
          <HomeScreen />
        </Container>
      </main>
      <Footer />
    </>

  );
}

export default App;
